  LocationSearchBloc() : super(SearchStateEmpty()) {
    on<LocationSearchEvent>((event, emit) async {
      emit(SearchStateLoading());

      final place = await LocationService().getPlace(event.searchString);
      final placeLat = place['geometry']['location']['lat'];
      final placeLong = place['geometry']['location']['lng'];

      final closestSensor = sensorLocations.reduce((curr, next) {
        final currDist =
            calcDistance(placeLat, placeLong, curr.latitude, curr.longitude);
        final nextDist =
            calcDistance(placeLat, placeLong, next.latitude, next.longitude);
        return currDist < nextDist ? curr : next;
      });

      List<PopularTimes> popularTimes;
      if (calcDistance(placeLat, placeLong, closestSensor.latitude,
              closestSensor.longitude) < SENSOR_RANGE) {
        Iterable jsonList = sensorHistory[closestSensor.id.toString()];
        popularTimes = List<PopularTimes>.from(
            jsonList.map((model) => PopularTimes.fromJson(model)));
      } else {
        popularTimes = List.empty();
      }

      final result = Location(
          name: place['name'],
          latitude: placeLat,
          longitude: placeLong,
          popularTimes: popularTimes);

      emit(SearchStateSuccess(result));
    });
  }
